import { api, isAxiosError } from "../axiosConfig";

interface DropDownComodoData {
    id: string;
    imovelId: string;
    tipo: string;
    numero: number;
    componente: [
        {
            id: string;
            comodoId: string;
            vistoriaId: string;
            tipo: string;
            obs: string;
            cor: string;
            estado: string;
            material: string;
        }
    ]
}

const data = async (
    id?: string,
    imovelId?: string,
    tipo?: string,
    numero?: number,
    componente?: [
        {
            id: string;
            comodoId: string;
            vistoriaId: string;
            tipo: string;
            obs: string;
            cor: string;
            estado: string;
            material: string;
        }
    ]
): Promise<DropDownComodoData[]> => {
    try {
        const response = await api.get(
            "/Comodo/PegarComodos",
            {
                params: {
                    id,
                    imovelId,
                    tipo,
                    numero,
                    componente,
                }
            }
        );

        // Transforma os dados para o formato esperado pelo Dropdown
        const dropdownData: DropDownComodoData[] = response?.data.map((comodo: DropDownComodoData) => ({
            label: `${comodo.tipo} - ${comodo.numero} - ${comodo.imovelId}`,
            value: comodo.id,
        }));

        return dropdownData;
    } catch (err) {
        if (isAxiosError(err)) {
            console.error("Axios error:", err);
            console.error("Response data:", err.response?.data);
            console.error("Request config:", err.config);
        } else {
            console.error("Non-Axios error:", err);
        }
        // Retorna null em caso de erro
        return null;
    }
};

export default data;
